import { List } from 'semantic-ui-react';


function Topics(){
    const topic = ["一","二"]; 
    return <List animated selection>
            {topic.map((topic) =>{
                return <List.Item key={topic.name}>{topic}</List.Item>;
            })}
           </List>;
}

export default Topics;
